B.Kg=new A.oK("# We link our relationships with independent agronomists and growers all over the western United States\n\nOur parent company AgriGro, based in Doniphan, MO, is a pioneer and leading authority in microbial-prebiotic technology and manufacturing. With over 40 years producing its proprietary, prebiotic formulations, AgriGro produces some of the most sought after technologies in this space.\n\nAgriGro West employs technologies and practices that put the grower first. What does that mean?\n\nIt means we look at things objectively. We are not tied to any fertilizer, chemical or seed company. That means we discuss and only deploy practices that have your best interest in mind. There are too many cases where growers are pressured into buying and applying inputs they don\u2019t need, because that is what a company pushes. Heavy rewards, cash benefits and trips are used to incentivize this kind of practice, while the grower gets stuck with a bill he or she doesn\u2019t need.\n\nAgriGro West leverages soil biology to help you micromanage your fertilizer, chemical inputs, and increase plant counts per foot of row, in order to produce profitable bushels. Yield always has a cost\u2026just because you produce more yield doesn\u2019t necessarily mean you produce more profit. When a grower focuses more on the biological side of crop production, profitability will go up.\n\nBiologicals are not created equal, there are major differences in efficacy. AgriGro West is confident in leading out over and above other technologies when it comes to price, consistent performance and ease of use.\n\nWe look forward to working with you!",!1,null,null,null,null,null,null,null,null,null,null,null,null,null,B.hh,B.hi,!0,B.hj,!1,null)
